import React from 'react'
import { Label ,Image, Icon} from "semantic-ui-react"
const Profile = (props) => {
    return (
        <div style={{  right: "3vw",fontSize:"x-large",top:"4vh",position:"absolute" ,textShadow: "3px 3px 3px #888888,5px 5px 7px #888888" }}>
                <Icon circular inverted color="teal" size="small" name="user"></Icon>
                <span style={{color:"white"}}>{props.name}</span>
        </div>

    )
}

export default Profile
